import mapa from '../img/mapOri.jpg'
import setaVolta from '../img/setaVolta.png'


const Mapa = () => {

    return(
        <div className='pagMapa'>

        <img  className='oriMap' src={mapa}/>
        <img  src={setaVolta}/>
        </div>
    )
}
export default Mapa;
